$(function(){$("form, [type='submit']").submit(function(o){o.preventDefault(),$.ajax({url:"api/login"}).done(o=>{console.log(o)})})}),$("#sign-up-btn").submit(function(o){o.preventDefault(),$.ajax({url:"/api/signup",data:{user:$("#user").val(),password:$("#pass").val()},method:"POST"}).done(o=>{console.log(o),window.location.replace("/")})}),$().submit(function(o){o.preventDefault(),$.ajax({url:"api/foods/create"}).done(o=>{console.log(o)})}),$().click(function(o){$.ajax({url:"api/foods/delete/:id"}).done(o=>{console.log(o)})}),$().submit(function(o){o.preventDefault(),$.ajax({url:"api/theme/update/:id"}).done(o=>{console.log(o)})}),$().submit(function(o){o.preventDefault(),$.ajax({url:"api/locations/create"}).done(o=>{console.log(o)})}),$().click(function(o){$.ajax({url:"api/locations/delete/:id"}).done(o=>{console.log(o)})}),$().click(function(o){$.ajax({url:"/api/advice"}).done(o=>{console.log(o)})}),$().submit(function(o){o.preventDefault(),$.ajax({url:"/api/advice/create"}).done(o=>{console.log(o)})});